// App.js
import React, { useState } from 'react';
import { NavigationContainer, useNavigation } from '@react-navigation/native';
import { createStackNavigator } from '@react-navigation/stack';

import HomeScreen from './HomeScreen'; // Import your HomeScreen component
import LevelScreen from './level_data/LevelScreen'; // Import your Level1 component

const Stack = createStackNavigator();

const initialState = {
  route: null,
};

export default function App() {
  const [state, setState] = useState(initialState);

  const navigation = useNavigation();

  return (
    <NavigationContainer>
      <Stack.Navigator initialRouteName="Home">
        <Stack.Screen name="Home" component={HomeScreen} options={{ headerShown: false }} />
        <Stack.Screen name="Level" component={LevelScreen} route={navigation.route} />
      </Stack.Navigator>
    </NavigationContainer>
  );
}
